<p>I have some documents that look like this:</p>
<pre><code>
{account:1234, myArray:[a,b,c]}
</code></pre>
<pre><code>
const newArray = [d,e,f];

const result = await Model.updateMany({
    account:1234,
  }, {
    $set:{
      // 'testUpdating':4,
      'myArray':newArray,
    }
  });



</code></pre>
<p>I get this back as a result:</p>
<pre><code>{
 &quot;ok&quot;: 0,
 &quot;n&quot;: 0,
 &quot;nModified&quot;: 0
}
</code></pre>
<p>However if i uncomment the <code>testUpdating:4</code> update, i get the expected result of having updated 18k documents, however only the 'testUpdating' field was modified.</p>
<p>I'm either doing something wrong, or it's just refusing to update the array field with a new array.</p>

