mongodb $lookup - but return from second collection only a part of the sub collection<p>I have two collections:</p>
<ul>
<li>posts</li>
<li>images</li>
</ul>
<p>The images should be returned based on the post id(s) but only a part of the image sub collection should be returned. The result should only return the current entry of the sub collection that has the same <code>lang</code>.</p>
<p>That's what I have so far:</p>
<h5>Post document</h5>
<pre><code>{
  &quot;_id&quot;: 1,
  &quot;lang&quot;: &quot;en&quot;,
  &quot;content&quot;: &quot;foobar&quot;
}
</code></pre>
<h5>Image document</h5>
<pre><code>{
  &quot;_id&quot;: ...,
  &quot;post_id&quot;: 1,
  &quot;title&quot;: [
    {
      &quot;lang&quot;: &quot;de&quot;,
      &quot;value&quot;: &quot;hallo welt&quot;
    },
    {
      &quot;lang&quot;: &quot;en&quot;,
      &quot;value&quot;: &quot;hello world&quot;
    }
  ],
}
</code></pre>
<h5>Current code</h5>
<pre><code>Post.aggregate([
  { $match: query },
  {
    $lookup: {
      from: 'images',
      localField: '_id',
      foreignField: 'post_id',
      as: 'images',
    },
  },
  {
    $project: {
      content: 1,
      lang: 1,
      images: 1,
    },
  }
]);
</code></pre>
<p>But this will return the whole sub collection (en/de) but I just need the matched language.
How can I solve this?</p>
<p>Thanks!</p>

