GeoData given different distances between two points in MySQL and MongoDB<p>I'm doing some benchmark between some databases, but comparing distance query between MySQL/Postgres and MongoDB gives me different results.</p>
<p>For example, in MySQSL</p>
<pre><code>SELECT ST_Distance_Sphere(
  POINT(-74.0060, 40.7128), -- New York
  POINT(-118.2437, 34.0522) -- Los Angeles
) AS distance;
</code></pre>
<p>gives me the result:</p>
<pre class="lang-sql prettyprint-override"><code>
     distance      

 3935737.605975668 

</code></pre>
<p>This result remains the same using equivalent functions in Postgres.</p>
<p>But in MongoDB (using NodeJS)</p>
<pre class="lang-js prettyprint-override"><code>// Inserting New York into database to be filtered afterwards

nodes_collection.insertOne({
  _id: 123456,
  location: { type: 'Point', coordinates: [-74.006, 40.7128]},
});


let result = client.nodes_collection.aggregate([
  {
    $geoNear: {
      near: {
        type: 'Point',
        coordinates: [-118.2437, 34.0522],  % Los Angeles
      },
      distanceField: 'distance',
      spherical: true,
    },
  },
  {
    $match: {
      _id: 123456,  // Filter only the point of interesting 
    },
  },
]);
</code></pre>
<p>gives me the result:</p>
<pre class="lang-sql prettyprint-override"><code>
     distance      

 3940132.347594769 

</code></pre>
<p>It shows an approximate 4,395 meters difference.</p>
<p>What am I missing here?</p>

